import React from 'react';

class NewNameInput extends React.Component {
    render() {
        return(
            <Input
            placeholder="Placeholder"
            className={classes.input}
            inputProps={{'aria-label': 'Description',}}
            />
        );
    }
}

export default NewNameInput;
